import React from "react";
import { ReactComponent as Logo } from "../assets/Logo.svg";
import Button from "../components/Button";
export function SignUp() {
  return (
    <div>
      <Logo />
      <form>
        <input placeholder="Nombres: "></input>
        <input placeholder="Apellidos: "></input>
        <input placeholder="Identificación: "></input>
        <input placeholder="Contacto: "></input>
        <input placeholder="Correo: "></input>
        <input placeholder="Confirmar correo "></input>
        <input placeholder="Contraseña: "></input>
        <input placeholder="Confirmar contraseña "></input>
        <Button type="submit" value="Crea tu cuenta" />
      </form>
    </div>
  );
}
